    c_START_TRACE,
    labeling( [ff], Colors).

different( _, []).
different( Output, [ [A,B] | R ]) :-
    member( A-CA, Output),
    member( B-CB, Output),
    CA #\= CB,
    different( Output, R ).

create_output( [],[],[]).
create_output( [N | Nodes], [C|Colors], [ N-C | Output]) :-
    create_output( Nodes, Colors, Output).


